import Navbar from "react-bootstrap/Navbar";

export default function Header() {
  return (
    <Navbar expand="lg">
      <Navbar.Brand>Put an icon</Navbar.Brand>
      <Navbar.Toggle>
        <Navbar.Collapse>
          <Navbar.Text>1</Navbar.Text>
          <Navbar.Text>2</Navbar.Text>
          <Navbar.Text>3</Navbar.Text>
          <Navbar.Text>4</Navbar.Text>
        </Navbar.Collapse>
      </Navbar.Toggle>
    </Navbar>
  );
}
